ferrerPolicy: "no-referrer", // no-referrer,\n\t\tbody: JSON.stringify(options),\n\t\tsignal: controller.signal,\n\t});\n\tclearTimeout(id);\n\treturn response.json();\n}\n\nfunction triggerTargetMbox(mboxName, parameters) {\n\tadobe.target.getOffer({\n\t\t"mbox": mboxName,\n\t\t"params": parameters,\n\t\t"success": function (offer) {\n\t\t\tadobe.target.applyOffer({\n\t\t\t\t"mbox": mboxName,\n\t\t\t\t"offer": offer\n\t\t\t});\n\t\t},\n\t\t"error": function (status, error) {\n\t\t\t_satellite.logger.error(\'Error\', status, error);\n\t\t}\n\t});\n}\n\nconst triggerDecisionScopes = (mboxName, parameters) => {\n\t_satellite.track(\'triggerDecisionScopes\', {\n\t\tdata: {\n\t\t\t__adobe: {\n\t\t\t\ttarget: parameters\n\t\t\t}\n\t\t},\n\t\tdecisionScopes: [mboxName]\n\t});\n}\n\nconst pushEventToDataLayer =(eventLabel) => {\n\twindow.digitalData = window.digitalData || [];\n\twindow.digitalData.push({\n\t\tevent: eventLabel\n\t});\n}\n\nconst setVars = (dataKey, value) => {\n\t_satellite.ext = _satellite.ext || {};\n\t_satellite.ext.data = _satellite.ext.data || {};\n\t_satellite.ext.data[dataKey] = value;\n}\n\nconst getVars = (dataKey) => {\n\t_satellite.ext = _satellite.ext || {};\n\t_satellite.ext.data = _satellite.ext.data || {};\n\treturn _satellite.ext.data[dataKey];\n}\n\nreturn (async function () {\n\tlet promise = getOffers();\n\tlet products = await promise.then((data) => {\n\t\tsetVars(\'rtdOffers\', data);\n\t\t_satellite.logger.debug(\'Productos Para Ti - Data: loaded\', data);\n\t\tlet is_client = (data.is_client ? data.is_client : false);\n\t\ttriggerTargetMbox(\'activity-Productos-Para-Ti-RTD\', { "is_client": is_client });\n\t\ttriggerDecisionScopes(\'activity-Productos-Para-Ti-RTD\', { "is_client": is_client });\n\t}).catch((error) => {\n\t\t_satellite.logger.error(`### Error: ${error.message}`);\n\t\tpushEventToDataLayer(error.message);\n\t});\n\treturn promise;\n})();',language:"javascript"}}]},{id:"RL1946c16d55564d17b477595ace18ebeb",name:"Google 